"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[9746],{9746:e=>{e.exports=JSON.parse('{"lessonId":"A2_U38","title":"\u0423\u0440\u043e\u043a 38: \u041f\u0443\u0442\u0430\u043d\u0438\u0446\u0430 \u0432 \u043c\u0435\u0441\u0442\u043e\u0438\u043c\u0435\u043d\u0438\u044f\u0445 (lo/la/le)","level":"B1","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: lo, la, los, las (\u041f\u0440\u044f\u043c\u043e\u0435 \u0434\u043e\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435)","content":[{"text":"<strong>`Lo, la, los, las`</strong> \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044e\u0442\u0441\u044f \u043a\u0430\u043a \u043f\u0440\u044f\u043c\u043e\u0435 \u0434\u043e\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435 \u0433\u043b\u0430\u0433\u043e\u043b\u0430 \u0434\u043b\u044f \u043e\u0431\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u0440\u0430\u043d\u0435\u0435 \u0443\u043f\u043e\u043c\u044f\u043d\u0443\u0442\u044b\u0445 \u043b\u044e\u0434\u0435\u0439, \u0436\u0438\u0432\u043e\u0442\u043d\u044b\u0445 \u0438\u043b\u0438 \u043f\u0440\u0435\u0434\u043c\u0435\u0442\u043e\u0432.<br><strong>lo, los \u2192 masculino</strong><br><strong>la, las \u2192 femenino</strong>"},{"list":["<i>\u2013\xbfMe dejas el diccionario? \u2013No puedo. <strong>Lo</strong> necesito.</i>","<i>\u2013\xbfMe dejas la pluma? \u2013No puedo. <strong>La</strong> necesito.</i>","<i>\u2013\xbfQuieres a tus padres? \u2013S\xed, <strong>los</strong> quiero.</i>"]},{"text":"<strong>\u041d\u041e:</strong> \u041d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043b\u044e\u0434\u0438 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044e\u0442 `le` \u0438 `les` \u0432\u043c\u0435\u0441\u0442\u043e `lo` \u0438 `los` \u0434\u043b\u044f \u043e\u0431\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u043b\u044e\u0434\u0435\u0439.<br><i>\u2013\xbfAmas a Juan? \u2013S\xed, <strong>le</strong> amo. / S\xed, <strong>le</strong> quiero.</i>"},{"text":"<strong>ATENCI\xd3N (La\xedsmo):</strong><br><i>\u2013\xbfMe dejas el diccionario? \u2013No puedo. <strong>Lo</strong> necesito.<br>\u2013Di a Sof\xeda que <strong>la</strong> llaman por tel\xe9fono. (\u0430 \u043d\u0435 <s>le</s> llaman)</i>"}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: le, les (\u041a\u043e\u0441\u0432\u0435\u043d\u043d\u043e\u0435 \u0434\u043e\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435)","content":[{"text":"<strong>`Le, les`</strong> \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044e\u0442\u0441\u044f \u043a\u0430\u043a \u043a\u043e\u0441\u0432\u0435\u043d\u043d\u043e\u0435 \u0434\u043e\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435 \u0433\u043b\u0430\u0433\u043e\u043b\u0430 \u0434\u043b\u044f \u043e\u0431\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u043b\u044e\u0434\u0435\u0439 (\u043c\u0443\u0436\u0447\u0438\u043d \u0438\u043b\u0438 \u0436\u0435\u043d\u0449\u0438\u043d).<br><i>\xbfQu\xe9 <strong>le</strong> pasa? <strong>Le</strong> duelen las muelas.</i>"},{"list":["<i>\u2013\xbfQu\xe9 <strong>le</strong> has regalado a Pedro? \u2013<strong>Le</strong> he regalado una cartera.</i>","<i>\u2013\xbfY a Mar\xeda? \u2013<strong>Le</strong> he regalado unos pendientes.</i>"]},{"text":"<strong>ATENCI\xd3N (Lo\xedsmo):</strong><br><i>A Mar\xeda <strong>le</strong> he regalado unos pendientes.<br>A Juan <strong>le</strong> han regalado un disco. (\u0430 \u043d\u0435 <s>lo</s> han regalado)</i>"},{"text":"<strong>`le, les` \u2192 `se`, \u043a\u043e\u0433\u0434\u0430 \u0435\u0441\u0442\u044c \u0434\u0432\u0430 \u043c\u0435\u0441\u0442\u043e\u0438\u043c\u0435\u043d\u0438\u044f-\u0434\u043e\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u044f.</strong><br><i>\u2013\xbfLe has dado la carta a Joaqu\xedn? \u2013S\xed, <strong>se</strong> la he dado.<br>\u2013\xbfLes has ense\xf1ado las notas a tus padres? \u2013S\xed, <strong>se las</strong> he ense\xf1ado.</i>"}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: `lo` \u043a\u0430\u043a \u043d\u0435\u0439\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0435 \u043c\u0435\u0441\u0442\u043e\u0438\u043c\u0435\u043d\u0438\u0435","content":[{"text":"<strong>`Lo`</strong> \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u043a\u0430\u043a \u043f\u0440\u044f\u043c\u043e\u0435 \u0434\u043e\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435 \u0434\u043b\u044f \u043e\u0442\u0441\u044b\u043b\u043a\u0438 \u043a \u0440\u0430\u043d\u0435\u0435 \u0443\u043f\u043e\u043c\u044f\u043d\u0443\u0442\u043e\u0439 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0438 \u0438\u043b\u0438 \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0438.<br><i>\u2013\xbfLe has dicho a Juan que me caso? \u2013S\xed, <strong>se lo</strong> he dicho, pero no se lo cree.<br>\u2013\xbfSabes que Ch\xe1vez est\xe1 muy enfermo? \u2013S\xed, <strong>lo</strong> s\xe9.</i>"},{"text":"<strong>`Lo`</strong> \u0442\u0430\u043a\u0436\u0435 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0432 \u0432\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u044f\u0445, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0443\u043a\u0430\u0437\u044b\u0432\u0430\u044e\u0442 \u043d\u0430 \u043e\u043f\u043f\u043e\u0437\u0438\u0446\u0438\u044e \u0438\u043b\u0438 \u0443\u0434\u0438\u0432\u043b\u0435\u043d\u0438\u0435 \u043f\u0435\u0440\u0435\u0434 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0435\u0439.<br><i>\u2013Felipe no es argentino. \u2013Claro que <strong>lo</strong> es.</i>"}]},{"type":"MultipleChoice","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 38.1: \u0412\u044b\u0431\u0435\u0440\u0438\u0442\u0435 \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u0443\u044e \u0444\u043e\u0440\u043c\u0443","tasks":[{"id":"u38_1_1","sentence":"1. \u2013\xbfQuieres este libro? \u2013No, no (le/lo) quiero. Gracias.","options":["le","lo"],"correctOption":"lo"},{"id":"u38_1_2","sentence":"2. \u2013\xbfMe dejas el l\xe1piz? \u2013No puedo. (Le/Lo) necesito.","options":["Le","Lo"],"correctOption":"Lo"},{"id":"u38_1_3","sentence":"3. \u2013\xbfQuieres a Ana? \u2013S\xed, (la/le) quiero.","options":["la","le"],"correctOption":"la"},{"id":"u38_1_4","sentence":"4. \u2013\xbfHa visto usted mis gafas? \u2013No, no (las/les) he visto.","options":["las","les"],"correctOption":"las"},{"id":"u38_1_5","sentence":"5. \u2013(Se/Le) (la/le) has regalado tu chaqueta roja a Luisa? \u2013No, no (se/le) (la/le) he regalado.","options":["Se la","Le la"],"correctOption":"Se la"},{"id":"u38_1_6","sentence":"6. \u2013(Se/Le) (la/le) he prestado.","options":["Se la","Le la"],"correctOption":"Se la"},{"id":"u38_1_7","sentence":"7. \u2013\xbfHan visto ustedes a mis padres? \u2013No, no (se/los) hemos visto.","options":["se","los"],"correctOption":"los"},{"id":"u38_1_8","sentence":"8. \u2013\xbf(Les/Los) has dejado el coche a tus hermanos? \u2013No, no (se/les) (le/lo) he dejado.","options":["Les, se lo","Los, se los"],"correctOption":"Les, se lo"},{"id":"u38_1_9","sentence":"9. \u2013\xbfHas visto a mis hermanas? \u2013S\xed, (las/les) he visto.","options":["las","les"],"correctOption":"las"},{"id":"u38_1_10","sentence":"10. In\xe9s, (la/le) llaman por tel\xe9fono.","options":["la","le"],"correctOption":"la"},{"id":"u38_1_11","sentence":"11. \xbfQuiere ver a Andr\xe9s? \u2013No, no quiero (verla/verlo).","options":["verla","verlo"],"correctOption":"verlo"},{"id":"u38_1_12","sentence":"12. (Les/Los) he comprado una televisi\xf3n a mis padres.","options":["Les","Los"],"correctOption":"Les"},{"id":"u38_1_13","sentence":"13. (La/Le) dije a Juana que no tengo dinero.","options":["La","Le"],"correctOption":"Le"},{"id":"u38_1_14","sentence":"14. Ayer (la/le) vi en el parque, Elisa.","options":["la","le"],"correctOption":"la"},{"id":"u38_1_15","sentence":"15. \u2013\xbfQu\xe9 (la/le) pasa a Elsa? \u2013(La/Le) duele la cabeza.","options":["le, Le","la, La"],"correctOption":"le, Le"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 38.2: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0441 las, la, los, las, le, les \u0438\u043b\u0438 se","tasks":[{"id":"u38_2_1","sentence":"1. \u2013\xbfHas visto a Juana? \u2013S\xed, ___ he visto.","answer":"la"},{"id":"u38_2_2","sentence":"2. ___ he regalado unos bombones a Sarita.","answer":"Le"},{"id":"u38_2_3","sentence":"3. \u2013\xbfHas llamado a tu padre, H\xe9ctor? \u2013S\xed, ___ he llamado.","answer":"le"},{"id":"u38_2_4","sentence":"4. \xbfQu\xe9 ___ has dicho a la profesora?","answer":"le"},{"id":"u38_2_5","sentence":"5. \xbf___ has regalado tu disco a Enrique? S\xed, ___ he regalado.","answer":"Le, se lo"},{"id":"u38_2_6","sentence":"6. \xbfHas visto a Concha? \u2013No, hoy no ___ he visto.","answer":"la"},{"id":"u38_2_7","sentence":"7. A Pili ___ duelen las muelas.","answer":"le"},{"id":"u38_2_8","sentence":"8. \xbfQu\xe9 ___ has comprado a tus padres? \u2013A mi padre ___ he comprado un libro y a mi madre ___ he comprado un pa\xf1uelo.","answer":"les, le, le"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 38.3: \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0439\u0442\u0435 \u043f\u043e\u0434\u0445\u043e\u0434\u044f\u0449\u0438\u0435 \u043c\u0435\u0441\u0442\u043e\u0438\u043c\u0435\u043d\u0438\u044f","tasks":[{"id":"u38_3_1","sentence":"1. \u2013\xbfLe has dicho a Juan que necesito el coche? \u2013S\xed, ___ he dicho, pero dice que \xe9l tambi\xe9n ___ necesita.","answer":"se lo, lo"},{"id":"u38_3_2","sentence":"2. \u2013\xbfSabes que me voy a Colombia? \u2013No, no ___ sab\xeda.","answer":"lo"},{"id":"u38_3_3","sentence":"3. \u2013Es verdad que \xc1ngela tiene mucho dinero? \u2013___ es, pero no ___ parece.","answer":"Lo, lo"},{"id":"u38_3_4","sentence":"4. \u2013\xbfSabe pap\xe1 que necesito dinero? \u2013___ sabe, pero dice que ___ pidas luego.","answer":"Lo, se lo"},{"id":"u38_3_5","sentence":"5. No ___ entiendo. He ofrecido ayuda a Teresa, pero no ___ ha aceptado.","answer":"lo, la"},{"id":"u38_3_6","sentence":"6. \u2013\xbfDe verdad que Ana es escritora? \u2013Claro que ___ es, pero no ___ sabe nadie.","answer":"lo, lo"},{"id":"u38_3_7","sentence":"7. \u2013Juan y Lola se han casado. \u2013Ya sab\xeda que ___ har\xedan. \xc9l ___ quiere mucho.","answer":"lo, la"},{"id":"u38_3_8","sentence":"8. \u2013Se ha muerto Momo. \u2013\xa1Cu\xe1nto ___ siento! Yo ___ quer\xeda mucho.","answer":"lo, lo"}]}]}')}}]);